import './App.css';

function App() {
  return (
    <div className="App">
      <div className="container">
        <nav class="navbar navbar-light bg-light">
          <div class="container-fluid">
            <a class="navbar-brand mb-0 h1" href="#">Navbar</a>
          </div>
        </nav>
      </div>
    </div>
  );
}

export default App;
